import React from "react";
import { Link } from "react-router-dom";
import cards from '../../json/housing.json'
import './card.css'

export default function Card(props){

    return (
        <Link to={'/housing/:id=' + cards.id} className="card">
            <img className="imgCard" src={props.cover} alt='housing'></img>
            <p className="textCard">{props.title}</p>
        </Link>
    )
}
